import { Tooltip } from 'chart.js'
import React from 'react'
import {Line} from 'react-chartjs-2'
 import ReactDom from 'react-dom'
function line(){
 const data={
    labels:["january","february","march","april","may","june"],
    dataset:[
        {
         label:'Ritik',
         data:[2,4,5,6,1,9],
         fill:true,

        
        }
        ,
        {
            label:'nikhil',
            data:[8,3,1,6,2,9],
            fill:true,
   
           
           }
    ]
 }

 const options={
    scales:{
      y:{
        beginAtZero:false,
      },
      x:{
        beginAtZero:false,
      }

    }
    ,
    plugins:{
        legend:{
            display:true,
            position:'top',
        }
        ,
        tooltip:{
            enabled:true,
        },
    }
 }

 return <Line data={data} options={options}></Line>

}

export default line;
